import styled from 'styled-components';

const Wrapper = styled.div`
  height: 25px;
  max-width: fit-content;
  padding: 0 15px;
  background: rgba(0, 126, 255, 0.08);
  border: 1px solid rgba(0, 126, 255, 0.24);
  border-radius: 2px;
`;

export default Wrapper;
